      `,difficulty:"dificil"},{id:2,title:"Dashboard Administrativo",description:"Um painel administrativo interativo para monitorar m\xE9tricas, usu\xE1rios e relat\xF3rios em tempo real.",isFavorite:!1,documentation:`
